import React from 'react';
import './App.css';
import Pomodoro from './components/Pomodoro';
import {createTheme, ThemeProvider} from '@material-ui/core/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: "#05445E"
    },

    secondary: {
      main: "#189AB4"
    }
  }
})

function App() {
  return (
    <div className="App">
      <Pomodoro/>
    </div>
  );
}

export default App;
